    <>
    <AwesomeSlider animation="cubeAnimation">
    <div data-src="./images/sliderA_01.jpg" />
    <div data-src="./images/sliderA_01.jpg" />
    <div data-src="./images/sliderA_01.jpg" />
  </AwesomeSlider>
    </>
  )
}

export default Slider
